import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import Singlebook from "./SingleBook";

class Home extends React.Component {
  render() {
    return (
      <Container>
        <Row className="g-4" xs={2} md={4}>
          {this.props.books.map((b) => (
            <Col className="col-4">
              <Singlebook book={b} />
            </Col>
          ))}
        </Row>
      </Container>
    );
  }
}

export default Home;

